// src/components/Projects.js
import React, { useState } from 'react';

const projectsData = [
  {
    title: 'LLM-Powered Customer Support Bot',
    description: 'Reduced response time by 70% and support costs by 40% using fine-tuned LLM',
    tags: ['LLM', 'NLP', 'LangChain'],
    github: '#',
    demo: '#',
    impact: 'ROI: 200% in first year'
  },
  {
    title: 'Sentiment Analysis for Social Media',
    description: 'Real-time brand monitoring system processing 100K+ posts daily',
    tags: ['NLP', 'Deep Learning'],
    github: '#',
    demo: '#',
    impact: '95% accuracy, 50ms latency'
  },
  {
    title: 'Predictive Maintenance System',
    description: 'ML model predicting equipment failures 48h in advance',
    tags: ['ML', 'Time Series'],
    github: '#',
    demo: '#',
    impact: 'Reduced downtime by 60%'
  },
  {
    title: 'Document Intelligence Platform',
    description: 'Automated extraction of key information from legal documents',
    tags: ['NLP', 'LLM'],
    github: '#',
    demo: '#',
    impact: 'Saved 200+ hours/month'
  },
  {
    title: 'Recommendation Engine',
    description: 'Personalized product recommendations for e-commerce platform',
    tags: ['ML', 'Recommendation'],
    github: '#',
    demo: '#',
    impact: 'Increased CTR by 35%'
  },
  {
    title: 'Fraud Detection System',
    description: 'Real-time anomaly detection for financial transactions',
    tags: ['ML', 'Anomaly Detection'],
    github: '#',
    demo: '#',
    impact: '99.2% accuracy in fraud detection'
  },
];

const allTags = ['All', ...new Set(projectsData.flatMap(p => p.tags))];

const Projects = ({ isVisible }) => {
  const [filter, setFilter] = useState('All');

  const filteredProjects =
    filter === 'All'
      ? projectsData
      : projectsData.filter(project => project.tags.includes(filter));

  return (
    <section
      id="projects"
      className={`section-padding bg-gray-50 dark:bg-gray-800 transition-all duration-700 ${isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'}`}
    >
      <div className="container mx-auto px-4">
        <h2 className="section-title">Featured Projects</h2>
        <p className="text-center text-gray-600 dark:text-gray-300 mb-12 max-w-3xl mx-auto">
          Real-world solutions with measurable business impact
        </p>

        {/* Tag Filters */}
        <div className="flex flex-wrap justify-center gap-3 mb-16">
          {allTags.map(tag => (
            <button
              key={tag}
              onClick={() => setFilter(tag)}
              className={`px-5 py-2 rounded-full text-sm font-medium transition-all duration-300 ${
                filter === tag
                  ? 'bg-primary-600 text-white shadow-lg'
                  : 'bg-white dark:bg-gray-700 text-gray-700 dark:text-gray-300 hover:bg-gray-100 dark:hover:bg-gray-600'
              }`}
            >
              {tag}
            </button>
          ))}
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredProjects.map((project, index) => (
            <div
              key={index}
              className="card group"
            >
              <div className="p-6">
                <div className="flex justify-between items-start mb-4">
                  <h3 className="text-xl font-bold text-primary-600 dark:text-primary-400 group-hover:text-accent-500 transition-colors">
                    {project.title}
                  </h3>
                  <span className="text-xs font-semibold bg-green-100 dark:bg-green-900/30 text-green-800 dark:text-green-300 px-2 py-1 rounded">
                    {project.impact}
                  </span>
                </div>

                <p className="text-gray-600 dark:text-gray-300 mb-6">
                  {project.description}
                </p>

                <div className="flex flex-wrap gap-2 mb-6">
                  {project.tags.map((tag, i) => (
                    <span
                      key={i}
                      className="text-xs bg-primary-100 dark:bg-primary-900/30 text-primary-800 dark:text-primary-200 px-2 py-1 rounded"
                    >
                      {tag}
                    </span>
                  ))}
                </div>

                <div className="flex gap-4">
                  <a
                    href={project.github}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="text-primary-600 dark:text-primary-400 hover:text-accent-500 font-medium flex items-center"
                  >
                    <svg className="w-5 h-5 mr-1" fill="currentColor" viewBox="0 0 24 24">
                      <path fillRule="evenodd" clipRule="evenodd" d="M12 2C6.477 2 2 6.477 2 12c0 4.42 2.87 8.17 6.84 9.5.5.08.66-.23.66-.5v-1.69c-2.77.6-3.36-1.34-3.36-1.34-.46-1.16-1.11-1.47-1.11-1.47-.91-.62.07-.6.07-.6 1 .07 1.53 1.03 1.53 1.03.87 1.52 2.34 1.07 2.91.83.09-.65.35-1.09.63-1.34-2.22-.25-4.55-1.11-4.55-4.92 0-1.11.38-2 1.03-2.71-.1-.25-.45-1.29.1-2.64 0 0 .84-.27 2.75 1.02.79-.22 1.65-.33 2.5-.33.85 0 1.71.11 2.5.33 1.91-1.29 2.75-1.02 2.75-1.02.55 1.35.2 2.39.1 2.64.65.71 1.03 1.6 1.03 2.71 0 3.82-2.34 4.66-4.57 4.91.36.31.69.92.69 1.85V21c0 .27.16.59.67.5C19.14 20.16 22 16.42 22 12A10 10 0 0012 2z"></path>
                    </svg>
                    GitHub
                  </a>
                  {project.demo && (
                    <a
                      href={project.demo}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-primary-600 dark:text-primary-400 hover:text-accent-500 font-medium flex items-center"
                    >
                      <svg className="w-5 h-5 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M10 6H6a2 2 0 00-2 2v10a2 2 0 002 2h10a2 2 0 002-2v-4M14 4h6m0 0v6m0-6L10 14"></path>
                      </svg>
                      Demo
                    </a>
                  )}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
